
class Star {
    constructor(nom, alpha, declinaison, magnitude_apparente) {
        this.name = nom
        this.alpha = alpha
        this.decl = declinaison
        if (!magnitude_apparente) {
            magnitude_apparente = 500
        }
        this.magn_app = magnitude_apparente
    }

    get_pos() {
        const x = Math.cos(deg2rad(this.alpha)) * Math.cos(deg2rad(this.decl))
        const y = Math.sin(deg2rad(this.alpha)) * Math.cos(deg2rad(this.decl))
        const z = Math.sin(deg2rad(this.decl))
        return [x, z, -y]
    }
}

